import json
from datetime import datetime

def entrance(occupation, birthday, hobby, key=None, value=None, json_str=None):
    if json_str:
        data = json.loads(json_str)
        if 'birthday' not in data:
            data['birthday'] = datetime.strptime(data['birthday'], '%d-%m-%Y')
        user_dict = data
    else:
        user_dict = {'occupation': occupation, 'birthday': birthday.strftime('%d-%m-%Y'), 'hobby': hobby}
    if key:
        if key == 'birthday':
            value = value.strftime('%d-%m-%Y')
        user_dict[key] = value
    if json_str:
        return user_dict
    else:
        return json.dumps(user_dict)

